<html>
    <head>
        <meta charset="utf-8"/>
        <style>
            table {
                border: 1px dashed darkgray;
                border-collapse: collapse;
                width: 98%;
            }
            tr {
                border: 1px dashed darkgray;
            }
            td {
                border: 1px dashed darkgray;
                min-width: 100px;
                padding: 10px;
            }
            select {
                font-size: 18px;
                font-family: 'Courier New', Courier, monospace;
            }
            div {
                width: 1800px;
                scrollbar-width: 10px;
                scroll-behavior: smooth;
                overflow-x: scroll;
            }
        </style>
    </head>
    <body>
        <div id="exprs1" style="margin-top: 61.8px;">
        </div>

        <script type="text/javascript">

            function changeDisplay(eleId) {
                let ele = document.getElementById(eleId);
                if (ele.style.display === 'none') {
                    ele.style.display = 'block';
                } else {
                    ele.style.display = 'none';
                }
            }

            function generateUUID() {
                let random
                let uuid = ''
                for (let i = 0; i < 32; i++) {
                    random = Math.random() * 16 | 0;  // 解释1
                    if (i === 8 || i === 12 || i === 16 || i === 20) { // 解释2
                    uuid += '-';
                    }
                    uuid += (i === 12 ? 4 : (i === 16 ? (random & 3 | 8) : random)).toString(16); // 解释3
                }
                return uuid;
            }

            function layoutExpression(expr) {
                var layoutHtml = "";
                if (expr.type == "CONDITIONAL") {
                    layoutHtml += layoutConditionalExpression(expr);
                } else if (expr.type == "NUMBER") {
                    layoutHtml += layoutNumberExpression(expr);
                } else if (expr.type == "VARIABLE") {
                    layoutHtml += layoutVariableExpression(expr);
                } else if (expr.type == "RELATIONAL") {
                    layoutHtml += layoutRelationalExpression(expr);
                } else if (expr.type == "SYMBOL") {
                    layoutHtml += layoutSymbolExpression(expr);
                } else if (expr.type == "ADDITIVE") {
                    layoutHtml += layoutBinaryExpression(expr);
                } else if (expr.type == "MULTIPLICATIVE") {
                    layoutHtml += layoutBinaryExpression(expr);
                } else if (expr.type == "PARENTHESIS") {
                    layoutHtml += layoutParenthesisExpression(expr);
                } else if (expr.type == "CONDITIONAL_OR" || expr.type == "CONDITIONAL_AND") {
                    layoutHtml += layoutBinaryExpression(expr);
                } else if (expr.type == "EQUALITY") {
                    layoutHtml += layoutBinaryExpression(expr);
                } else if (expr.type == "METHOD_INVOCATION") {
                    layoutHtml += layoutMethodInvocationExpression(expr);
                }
                return layoutHtml;
            }


            function layoutMethodInvocationExpression(expr) {
                var layoutHtml = "";
                let uuid = generateUUID();
                layoutHtml += "<p><input type='button' onclick=changeDisplay('" + uuid + "') value='显示、隐藏Method'/></p>";
                layoutHtml += "<table id='" + uuid + "'>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>方法名</td>";
                layoutHtml += "</tr>";
                layoutHtml += "<tr>";
                layoutHtml += "<td>";
                layoutHtml += expr.children[0].text;
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>参数列表</td>";
                layoutHtml += "</tr>";
                layoutHtml += "<tr><td>";

                layoutHtml += "<table id='" + uuid + "'>";
                for (let index in expr.children) {
                    if (index == 0) {
                        continue;
                    }
                    
                    let uuid2 = generateUUID();
                    layoutHtml += "<tr><td><input type='button' onclick=changeDisplay('" + uuid2 + "') value='显示、隐藏Param'/></td></tr>";

                    layoutHtml += "<tr>";
                    layoutHtml += "<td><div id='" + uuid2 + "'>";
                    layoutHtml += layoutExpression(expr.children[index]);
                    layoutHtml += "</div></td>";
                    layoutHtml += "</tr>";
                }
                layoutHtml += "</table>";
                layoutHtml += "</td></tr>";

                
                layoutHtml += "</table>";

                return layoutHtml;
            }

            function layoutBinaryExpression(expr) {
                var layoutHtml = "";
                let uuid = generateUUID();
                layoutHtml += "<p><input type='button' onclick=changeDisplay('" + uuid + "') value='显示、隐藏'/></p>";
                layoutHtml += "<table id='" + uuid + "'>";
                
                for (let index in expr.children) {
                    layoutHtml += "<tr>";
                    let child = expr.children[index];
                    if (child.type == "SYMBOL") {
                        layoutHtml += "<td>运算符</td>";
                    } else if (child.type == "NUMBER") {
                        layoutHtml += "<td>数值</td>";
                    } else if (child.type == "VARIABLE") {
                        layoutHtml += "<td>变量</td>";
                    } else {
                        layoutHtml += "<td>表达式</td>";
                    }
                    layoutHtml += "<td>";
                    layoutHtml += layoutExpression(child);
                    layoutHtml += "</td>";
                    layoutHtml += "</tr>";
                }
                
                layoutHtml += "</table>";

                return layoutHtml;
            }

            function layoutParenthesisExpression(expr) {
                var layoutHtml = "";
                let uuid = generateUUID();
                layoutHtml += "<p><input type='button' onclick=changeDisplay('" + uuid + "') value='显示、隐藏'/></p>";
                layoutHtml += "<table id='" + uuid + "'>";
                
                for (let index in expr.children) {
                    layoutHtml += "<tr>";
                    layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[index]);
                    layoutHtml += "</td>";
                    layoutHtml += "</tr>";
                }
                
                layoutHtml += "</table>";

                return layoutHtml;
            }

            function layoutSymbolExpression(expr) {
                var layoutHtml = "<select>";
                layoutHtml += "<option>" + expr.text + "</option>";
                layoutHtml += "</select>"
                return layoutHtml;
            }

            function layoutRelationalExpression(expr) {
                var layoutHtml = "";
                layoutHtml += "<!-- CONDITIONAL -->";
                layoutHtml += "<table>";
                layoutHtml += "<tr>";
                layoutHtml += "<td>左表达式</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[0]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>符号</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[1]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>右表达式</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[2]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                layoutHtml += "</table>";

                return layoutHtml;
            }

            function layoutVariableExpression(expr) {
                var layoutHtml = "<p><a href='javascript:void(0);'>" + expr.text + "</a></p>";

                return layoutHtml;
            }

            function layoutNumberExpression(expr) {
                var layoutHtml = "<p style='color: red;'>" + expr.text + "</p>";
                return layoutHtml;
            }

            function layoutConditionalExpression(expr) {
                var layoutHtml = "";
                layoutHtml += "<!-- CONDITIONAL -->";
                layoutHtml += "<table>";
                layoutHtml += "<tr>";
                layoutHtml += "<td>如果</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[0]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>那么</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[1]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                
                layoutHtml += "<tr>";
                layoutHtml += "<td>否则</td>";
                layoutHtml += "<td>";
                    layoutHtml += layoutExpression(expr.children[2]);
                layoutHtml += "</td>";
                layoutHtml += "</tr>";
                layoutHtml += "</table>";

                return layoutHtml;
            }

            function layoutExpressions(exprs) {
                var layoutHtml = "";
                for (let index in exprs) {
                    layoutHtml += layoutExpression(exprs[index]);
                }
                console.log(layoutHtml);
                return layoutHtml;
            }

        </script>
